Até agora esotu com dificuldade de encontrar case para esse modelo em grandes lojas, se puderem ajudar pedindo para incluirem esse modelo, tks https://www.gocase.com.br/abaixo-assinado
;
;E eu vi diversos reviews, e pelo preço dos outros celulares do momento, esse realmente é uma excelente opção. A tela é muito muito boa parecendo que a maiorias das imagens (até vídeos em 4k) estão em qualidade  mais baixa, as cameras são boas mesmo, em diferentes iluminações, só não gostei da abertura da camera ffrontal. A bateria é muito boa, uso muito camera, vídeo, 2 chips, e dura tranquilo 2 dias, até agora não tive problemas com o celular travar, é o melhor "investimento" que fiz em eletrônico até o momento, recomendo. PS.: eu trabalho com deisgn, então ter um ceular rapido com tela, som, camera e bateria duravel são de extrema importância para mim e essa foi a melhor opção.

Não se compara iPhone com outros dispositivos Android. A Apple faz produtos DURÁVEIS, que recebem anos de atualizações. Android trava, é instável, é inseguro, é mal otimizado, e ainda recebe pouquíssimas  atualizações (se comparados ao IOS). Antes de recomendar um Galaxy S10, Redmi Note 8 ou outro dispositivo Android no luga do iPhone SE, faça o seguinte: Pesquise! 
;
;O iPhone 5S foi lançado em 2013. ATÉ HOJE, recebe atualizações de segurança para o IOS 12. Que Android do mesmo ano teve uma vida útil tão longa?
;
;Vejo comentários bobos de pessoas reclamando do tamanho da tela, ou pelo fato de ter mais bordas que outros modelos. Caso não tenha gostado do tamanho da tela, é muito simples, esse smartphone não é pra você. A Apple está visando um público bem específico, de pessoas que assim como eu, preferem telas menores. Nenhum dos fatores que tecnicamente o desqualificariam, fazem do iPhone SE uma opção inferior a outros celulares. Apple é outro nível. Não se compara.

